import React from 'react';
import '../css/header.css';
import HomeLogo from "./HomeLogo";

function Header() {
    return (
        <section id="header-wrapper" className="margin-bottom-0">
            <div id="header" className="max-width-1800px">
                <div id="uvp">
                    <HomeLogo />
                    <h1>CHECK24 GenDev Streaming Package Comparison Challenge</h1>
                    <h2>Ein herausforderndes Projekt für echte Problemlöser</h2>
                    <h3>
                        Die Lösung dieser Challenge hat mich dazu gebracht, effiziente Algorithmen zu entwickeln, 
                        clevere Datenstrukturen zu nutzen und kreative Wege zu finden, um die besten 
                        Streaming-Pakete für Fußballfans zu ermitteln. Von der Team- und Paketwahl bis zur 
                        Optimierung der Kosten – dieses Projekt war sowohl technisch anspruchsvoll als auch unglaublich spannend!
                    </h3>
                </div>
                <img id="header-image"
                     src={`${process.env.PUBLIC_URL}/images/StreamingChallenge.png`}
                     alt="Illustration einer Person, die ein UI für die Auswahl der besten Streaming-Pakete nutzt, mit Fußballsymbolen und einer minimalistischen Benutzeroberfläche." />
            </div>
        </section>
    );
}

export default Header;
